import React from 'react';
import '../styles/News.css'; // Link the CSS file for News

function News() {
  return (
    <div className="news-container">
      <h1>Welcome to the News Page</h1>
      <p>Stay updated with the latest news here.</p>
    </div>
  );
}

export default News;
